import React,{Component} from 'react';
import Card from './Card';

class CardList extends Component{
	render(){
			const cardComponent = robots.map(e=>{
				return 	<Card id={e.id} name={e.name} email={e.email}/>

			})

		return (
<div>
	<cardComponent />
	</div>
			);
	}
}

export default CardList;
